import React from 'react';

import { Container, Title, Amount } from './styles';

interface Props {
  title: string;
  amount: string;
  color: string;
}

function HistoryCard({ title, amount, color }: Props) {
  return (
    <Container color={color}>
      <Title>{title}</Title>
      <Amount>{amount}</Amount>
    </Container>
  );
}

export default HistoryCard;
